import React from 'react'
import ProgressBar from 'react-animated-progress-bar'

function ProgressBarFunction() {
  return (
    <ProgressBar
      progress={90}
      width={150}
      height={20}
      strokeWidth={5}
      strokeColor="#2196F3"
      trailColor="#ccc"
    />
  )
}

export default ProgressBarFunction
